import { useState } from "preact/compat";
import { FunctionalComponent, h } from 'preact';
import "./styles.css";

type Align = "left" | "right" | "top" | "bottom" | "top-left" | "top-right" | "bottom-left" | "bottom-right";
type Props = {
    children: string;
    alignIcons: string;
    link: string
  };

  interface Item {
    id: number;
    name: string;
    link: string;
    icon: any;
  }


  import {
    EmailIcon,
    EmailShareButton,
    FacebookIcon,
    FacebookMessengerIcon,
    FacebookMessengerShareButton,
    FacebookShareButton,
    FacebookShareCount,
    HatenaIcon,
    HatenaShareButton,
    HatenaShareCount,
    InstapaperIcon,
    InstapaperShareButton,
    LineIcon,
    LineShareButton,
    LinkedinIcon,
    LinkedinShareButton,
    LivejournalIcon,
    LivejournalShareButton,
    MailruIcon,
    MailruShareButton,
    OKIcon,
    OKShareButton,
    OKShareCount,
    PinterestIcon,
    PinterestShareButton,
    PinterestShareCount,
    PocketIcon,
    PocketShareButton,
    RedditIcon,
    RedditShareButton,
    RedditShareCount,
    TelegramIcon,
    TelegramShareButton,
    TumblrIcon,
    TumblrShareButton,
    TumblrShareCount,
    TwitterIcon,
    TwitterShareButton,
    VKIcon,
    VKShareButton,
    VKShareCount,
    ViberIcon,
    ViberShareButton,
    WeiboIcon,
    WeiboShareButton,
    WhatsappIcon,
    WhatsappShareButton,
    WorkplaceIcon,
    WorkplaceShareButton,
  } from "./react-share";
import React from "preact/compat";


  //ref https://codepen.io/volitilov/pen/gxvyRX
  const getAllIcons = (size = 40) => [
    { name: "facebook", icon: <FacebookIcon size={size} /> },
    { name: "twitter", icon: <TwitterIcon size={size} /> },
    { name: "linkedin", icon: <LinkedinIcon size={size} /> },
    { name: "pinterest", icon: <PinterestIcon size={size} /> },
    { name: "facebook-messenger", icon: <FacebookMessengerIcon size={size} /> },
    { name: "telegram", icon: <TelegramIcon size={size} /> },
    { name: "whatsapp", icon: <WhatsappIcon size={size} /> },
    { name: "vk", icon: <VKIcon size={size} /> },
    { name: "ok", icon: <OKIcon size={size} /> },
    { name: "reddit", icon: <RedditIcon size={size} /> },
    { name: "tumblr", icon: <TumblrIcon size={size} /> },
    { name: "live-journal", icon: <LivejournalIcon size={size} /> },
    { name: "mailru", icon: <MailruIcon size={size} /> },
    { name: "email", icon: <EmailIcon size={size} /> },
    { name: "viber", icon: <ViberIcon size={size} /> },
    { name: "workplace", icon: <WorkplaceIcon size={size} /> },
    { name: "line", icon: <LineIcon size={size} /> },
    { name: "weibo", icon: <WeiboIcon size={size} /> },
    { name: "pocket", icon: <PocketIcon size={size} /> },
    { name: "instapaper", icon: <InstapaperIcon size={size} /> },
    { name: "hatena", icon: <HatenaIcon size={size} /> },
  ];

  const getShareIcon = (name: string, shareUrl:string, size = 64) => {
    if (name === "facebook") {
      return (
        <div className="Demo__some-network">
          <FacebookShareButton
            url={shareUrl}
            quote={name}
            className="Demo__some-network__share-button"
          >
            <FacebookIcon size={size} />
          </FacebookShareButton>

          {/* <div>
            <FacebookShareCount
              url={shareUrl}
              className="Demo__some-network__share-count"
            >
              {(count) => count}
            </FacebookShareCount>
          </div> */}
        </div>
      );
    } else if (name === "facebook-messenger") {
      return (
        <div className="Demo__some-network">
          <FacebookMessengerShareButton
            url={shareUrl}
            appId="521270401588372"
            className="Demo__some-network__share-button"
          >
            <FacebookMessengerIcon size={size} />
          </FacebookMessengerShareButton>
        </div>
      );
    } else if (name === "twitter") {
      return (
        <div className="Demo__some-network">
          <TwitterShareButton
            url={shareUrl}
            title={name}
            className="Demo__some-network__share-button"
          >
            <TwitterIcon size={size} /> 
          </TwitterShareButton>

          {/* <div className="Demo__some-network__share-count">&nbsp;</div> */}
        </div>
      );
    } else if (name === "telegram") {
      return (
        <div className="Demo__some-network">
          <TelegramShareButton
            url={shareUrl}
            title={name}
            className="Demo__some-network__share-button"
          >
            <TelegramIcon size={size} />
          </TelegramShareButton>

          {/* <div className="Demo__some-network__share-count">&nbsp;</div> */}
        </div>
      );
    } else if (name === "whatsapp") {
      return (
        <div className="Demo__some-network">
          <WhatsappShareButton
            url={shareUrl}
            title={name}
            separator=":: "
            className="Demo__some-network__share-button"
          >
            <WhatsappIcon size={size} />
          </WhatsappShareButton>

          {/* <div className="Demo__some-network__share-count">&nbsp;</div> */}
        </div>
      );
    } else if (name === "linkedin") {
      return (
        <div className="Demo__some-network">
          <LinkedinShareButton
            url={shareUrl}
            className="Demo__some-network__share-button"
          >
            <LinkedinIcon size={size} />
          </LinkedinShareButton>
        </div>
      );
    } else if (name === "pinterest") {
      return (
        <div className="Demo__some-network">
          <PinterestShareButton
            url={String(window.location)}
          //   media={`${String(window.location)}/${exampleImage}`}
            className="Demo__some-network__share-button"
          >
            <PinterestIcon size={size} />
          </PinterestShareButton>

          {/* <div>
            <PinterestShareCount
              url={shareUrl}
              className="Demo__some-network__share-count"
            />
          </div> */}
        </div>
      );
    } else if (name === "vk") {
      return (
        <div className="Demo__some-network">
          <VKShareButton
            url={shareUrl}
          //   image={`${String(window.location)}/${exampleImage}`}
            className="Demo__some-network__share-button"
          >
            <VKIcon size={size} />
          </VKShareButton>

          {/* <div>
            <VKShareCount
              url={shareUrl}
              className="Demo__some-network__share-count"
            />
          </div>*/}
        </div> 
      );
    } else if (name === "ok") {
      return (
        <div className="Demo__some-network">
          <OKShareButton
            url={shareUrl}
          //   image={`${String(window.location)}/${exampleImage}`}
            className="Demo__some-network__share-button"
          >
            <OKIcon size={size} />
          </OKShareButton>

          {/* <div>
            <OKShareCount
              url={shareUrl}
              className="Demo__some-network__share-count"
            />
          </div> */}
        </div>
      );
    } else if (name === "reddit") {
      return (
        <div className="Demo__some-network">
          <RedditShareButton
            url={shareUrl}
            title={name}
            windowWidth={660}
            windowHeight={460}
            className="Demo__some-network__share-button"
          >
            <RedditIcon size={size} />
          </RedditShareButton>

          {/* <div>
            <RedditShareCount
              url={shareUrl}
              className="Demo__some-network__share-count"
            />
          </div> */}
        </div>
      );
    } else if (name === "tumblr") {
      return (
        <div className="Demo__some-network">
          <TumblrShareButton
            url={shareUrl}
            title={name}
            className="Demo__some-network__share-button"
          >
            <TumblrIcon size={size} />
          </TumblrShareButton>

          {/* <div>
            <TumblrShareCount
              url={shareUrl}
              className="Demo__some-network__share-count"
            />
          </div> */}
        </div>
      );
    } else if (name === "live-journal") {
      return(
        <div className="Demo__some-network">
          <LivejournalShareButton
            url={shareUrl}
            title={name}
            description={shareUrl}
            className="Demo__some-network__share-button"
          >
            <LivejournalIcon size={size} />
          </LivejournalShareButton>
        </div>
      );
    } else if (name === "mailru") {
      return (
        <div className="Demo__some-network">
          <MailruShareButton
            url={shareUrl}
            title={name}
            className="Demo__some-network__share-button"
          >
            <MailruIcon size={size} />
          </MailruShareButton>
        </div>
      );
    } else if (name === "email") {
      return (
        <div className="Demo__some-network">
          <EmailShareButton
